import Link from 'next/link'

function Navbar() {
  return (
    <>

      <h1>My App</h1>
      <Link href = "/About">Home</Link>
        {/* <li>About</li>
        <li>API</li> */}
      {this.props.children}
    </>);
}

export default Navbar;
